import React from 'react';
import './UserProfile.css';

type User = {
  avatar?: string;
  username: string;
  profession?: string;
  bio?: string;
};

interface UserProfileProps {
  user: User;
  size?: number; // avatar diameter in px
}

const UserProfile: React.FC<UserProfileProps> = ({ user, size = 64 }) => {
  const { avatar, username, profession, bio } = user;

  // Generate initials for fallback avatar
  const initials = username
    .split(' ')
    .map((n) => n.charAt(0))
    .slice(0, 2)
    .join('')
    .toUpperCase();

  const avatarStyle: React.CSSProperties = {
    width: size,
    height: size,
  };

  return (
    <div className="user-profile-card" role="group" aria-label={`用户资料：${username}`}>
      <div className="user-avatar" style={avatarStyle}>
        {avatar ? (
          <img src={avatar} alt={username} />
        ) : (
          <div className="avatar-initials" aria-label="头像初始字母">
            {initials}
          </div>
        )}
      </div>
      <div className="user-info">
        <div className="user-name">{username}</div>
        {profession && <div className="user-profession">{profession}</div>}
        {bio && <div className="user-bio">{bio}</div>}
      </div>
    </div>
  );
};

export default UserProfile;

