.user-profile-card {
  display: flex;
  align-items: center;
  gap: 16px;
  padding: 14px 16px;
  border-radius: 12px;
  background: #ffffff;
  box-shadow: 0 6px 16px rgba(0, 0, 0, 0.08);
  max-width: 520px;
}

.user-avatar {
  border-radius: 50%;
  overflow: hidden;
  background: #e6e6e6;
  display: inline-flex;
  align-items: center;
  justify-content: center;
}

.user-avatar img {
  width: 100%;
  height: 100%;
  object-fit: cover;
  display: block;
}

.avatar-initials {
  width: 100%;
  height: 100%;
  display: inline-flex;
  align-items: center;
  justify-content: center;
  color: #ffffff;
  background: linear-gradient(135deg, #667eea 0%, #764ba9 100%);
  font-weight: 700;
  font-size: 1rem;
  user-select: none;
}

.user-info {
  display: flex;
  flex-direction: column;
}

.user-name {
  font-weight: 700;
  font-size: 1.05rem;
  margin-bottom: 4px;
  color: #111;
}

.user-profession {
  font-size: 0.9rem;
  color: #666;
  margin-bottom: 6px;
}

.user-bio {
  font-size: 0.88rem;
  color: #555;
} 

